{"movieId": "1284957", "picture": "https://p0.meituan.net/movie/cfd17fcf2802ec28dfa550b6cffbf6ba98553.jpg@464w_644h_1e_1c", "name": "杀死比尔2", "name2": "Kill Bill: Vol. 2", "type": [" 动作 ", " 惊悚 ", " 犯罪 "], "place": "美国", "length": "137分钟", "time": "2004-04-16多平台上线", "description": "故事接着上一集开场， “黑蛇” （乌玛·瑟曼饰）在雪地里打败“水腹蛇” （刘玉玲饰）后，接着来到德克萨斯州的奥斯汀，她的下一个目标追杀目标是“响尾蛇”、比尔的贴身侍卫巴德 （迈克尔·马德森饰）。巴德已经洗手不干杀手了，他成了一个无业游民，住在活动的拖车里。“黑蛇”跟踪了他很久，最后决定夜里到他的拖车里干掉他。可是狡猾的巴德早就拿着枪在屋里等她了，“黑蛇”胸口中枪，接着又被巴德用药麻醉，昏死过去。巴德打电话给心狠手辣的“加利福尼亚蛇”艾尔 （达丽尔·汉纳饰），即那个曾经企图用一只杜冷丁谋害“黑蛇”的独眼女人，她还是比尔的新情人。巴德要将“黑蛇”手里那把服部本三铸造的武士刀，以100万美元的高价卖给她。艾尔接受了巴德的开价，条件是巴德要把“黑蛇”干掉。就在艾尔赶往奥斯汀的时候， 巴德用卡车将昏死的“黑蛇”运到墓地，把她装在木棺里活埋在五六米深的地下。可是，躺在木棺里的“黑蛇”苏醒过来，她想起了师父白眉老道曾经教她的一种奇特功夫。镜头闪回到“黑蛇”跟白眉老道 （刘家辉饰）学功夫的画面。艾尔的眼睛正是被这个150岁的武林高人弄瞎的。“黑蛇”学到的招数，包括如何在仅仅两寸的回旋余地里冲破坚固的墙，当时她曾用坚硬的木板做训练。就这样，“黑蛇”利用功夫从地下爬了出来，找巴德复仇去。艾尔到了巴德的拖车中，拿到了“黑蛇”留下的武士刀，她给了巴德100万美元。就在巴德数钱的时候，一条黑色曼巴蛇出现了，巴德被毒蛇咬死。很快，“黑蛇”也出现在拖车里，一场昏天黑地的厮杀开始了，毫无疑问，最后艾尔也难逃被杀死的命运。最后，“黑蛇”追踪比尔 （ 大卫·卡拉丁 饰）来到了墨西哥，除了武士刀，她又配备了一支火力强劲的来福枪。就在她瞄准比尔，要对他下手的时候，一个五六岁的小姑娘出现了，跳入比尔的怀抱。“黑蛇”很快就意识到这是她的女儿——她腹中的孩子并没有死，而且一直在比尔身边。“黑蛇”和比尔见面了，后者说他血洗婚礼只为她怀了他的孩子，却又背叛了他嫁给他人。为了夺回自己的孩子，也为报仇雪恨，“黑蛇”和比尔进行了一场决斗。决斗中，“黑蛇”用白眉老道传授的功夫“五指穿心掌”将比尔致于死地。影片结尾，“黑蛇”和女儿幸福地生活在一起。", "director": ["https://p0.meituan.net/moviemachine/1b4c08c4f8099ae71e595891dbc9304f39844.jpg@128w_170h_1e_1c", "昆汀·塔伦蒂诺"], "actors": [["https://p0.meituan.net/movie/d192525dcf625e282eb941b53c81032e45332.jpg@128w_170h_1e_1c", "刘玉玲", "饰：御莲 O-Ren Ishii,Cottonmouth (archive footage)"], ["https://p0.meituan.net/moviemachine/fe0d3d01ff2bdcf6f0d6832ef906194b57193.jpg@128w_170h_1e_1c", "乌玛·瑟曼", "饰：新娘 Beatrix Kiddo,The Bride,Black Mamba"], ["https://p1.meituan.net/movie/a3f1b572fd3977862bda935f9ae380bd31933.jpg@128w_170h_1e_1c", "刘家辉", "饰：白眉 Pai Mei (as Gordon Liu)"], ["https://p1.meituan.net/movie/d14512368446ba617408949aaaff341552182.jpg@128w_170h_1e_1c", "迈克尔·马德森", "饰：巴德 Budd,Sidewinder"], ["https://p0.meituan.net/movie/d192525dcf625e282eb941b53c81032e45332.jpg@128w_170h_1e_1c", "刘玉玲", "饰：御莲 O-Ren Ish