{"movieId": "344881", "picture": "https://p0.meituan.net/movie/6d4d025187c90a7f3e3aa82dcad5824529470.jpg@464w_644h_1e_1c", "name": "子弹横飞百老汇", "name2": "Bullets Over Broadway", "type": [" 喜剧 ", " 犯罪 "], "place": "美国", "length": "98分钟", "time": "1995-02-24腾讯视频独播", "description": "长久以来，剧作家大卫（约翰·库萨克 John Cusack 饰）都过着郁郁不得志的生活，艺术家特有的清高让他对如今腐败混乱的话剧界充满了失望之情。为了讨好情妇奥利芙（詹妮弗·提莉 Jennifer Tilly 饰），黑帮大佬看中了名不见经传的大卫的剧本想要投资，作为前提条件 ，大卫必须让奥利芙饰演主角。虽然奥利芙唠叨的个性和蹩脚的演技让大卫深感抓狂，但在利益面前，他痛苦的屈服了。就这样，一个奇怪的剧组诞生了。 剧本的漏洞，女演员们之间的矛盾，男主演日益肥胖的身材都让大卫感到绝望，但令他惊奇的是，一直监视着奥利芙的保镖契奇（查兹·帕尔明特瑞 Chazz Palminteri 饰）在无意中展现了过人的编剧才能。在契奇的帮助下，被改写的剧本居然获得了盛大的成功，与此同时，契奇对由自己操刀的剧本展现出的病态执着和剧组里混乱的男女关系让大卫陷入了另一个困境……", "director": ["https://p1.meituan.net/movie/1f58e0afca14d862684e513300e87ca919445.jpg@128w_170h_1e_1c", "伍迪·艾伦"], "actors": [["https://p0.meituan.net/movie/b7b20f233def5c998030b9e183d7ba2e56708.jpg@128w_170h_1e_1c", "约翰·库萨克", "饰：大卫·肖恩 David Shayne"], ["https://p0.meituan.net/moviemachine/8a8ff7e9aca3c07dcdfdfb322f77967539788.jpg@128w_170h_1e_1c", "黛安娜·威斯特", "饰：海伦·辛克莱 Helen Sinclair"], ["https://p1.meituan.net/movie/0921639c237b064684af27ef4b253c7924269.jpg@128w_170h_1e_1c", "詹妮弗·提莉", "饰：奥利弗·尼尔 Olive Neal"], ["https://p1.meituan.net/movie/491521e99a4bc1e1fca30a6e38ea7f7a43528.jpg@128w_170h_1e_1c", "查兹·帕尔明特瑞", "饰：切奇 Cheech"], ["https://p0.meituan.net/movie/b7b20f233def5c998030b9e183d7ba2e56708.jpg@128w_170h_1e_1c", "约翰·库萨克", "饰：大卫·肖恩 David Shayne"], ["https://p0.meituan.net/moviemachine/8a8ff7e9aca3c07dcdfdfb322f77967539788.jpg@128w_170h_1e_1c", "黛安娜·威斯特", "饰：海伦·辛克莱 Helen Sinclair"], ["https://p1.meituan.net/movie/0921639c237b064684af27ef4b253c7924269.jpg@128w_170h_1e_1c", "詹妮弗·提莉", "饰：奥利弗·尼尔 Olive Neal"], ["https://p1.meituan.net/movie/491521e99a4bc1e1fca30a6e38ea7f7a43528.jpg@128w_170h_1e_1c", "查兹·帕尔明特瑞", "饰：切奇 Cheech"], ["https://p0.meituan.net/movie/a78a5aa956dffb28a96b0ee65e04574134784.jpg@128w_170h_1e_1c", "杰克·瓦尔登", "饰：朱莉安·马克思 Julian Marx"], ["https://p0.meituan.net/movie/5ccf9a0769c864a6703cdb02712f0a1a24405.jpg@