{"movieId": "1331606", "picture": "https://p0.meituan.net/movie/af45b094c0f7da212c8e3711cce29b30133000.jpg@464w_644h_1e_1c", "name": "在这世界的角落", "name2": "この世界の片隅に", "type": [" 剧情 ", " 动画 ", " 战争 "], "place": "日本", "length": "129分钟", "time": "2016-10-28日本上映", "description": "小铃（能年玲奈 配音）是一个整日里慢慢腾腾迷迷糊糊的姑娘，最大的爱好就是画画。眼看着到了嫁人的年纪，在父母的安排下，小铃来到了吴市，嫁给了名为北条周作（细谷佳正 配音）的男子，成为了北条家的媳妇。 径子（尾身美词 配音）是周作的姐姐，带着女儿晴美（稻叶菜月 配音）住回了娘家。和贤惠老实的小铃不同，径子性格张扬而泼辣，虽然她常常对唯唯诺诺的小铃感到不满，但两人之间的感情其实十分要好。战争开始了，越来越多的战斗机飞过天空，刺耳的防空警报声常常划破夜晚的宁静，战争的阴影一点一点的覆盖着北条一家人的生活。在一场空袭中，晴美不幸遇难，小铃亦失去了右手再也无法作画，然而，在如此残酷的时局下，一家人依然没有放弃对生存的渴望。", "director": ["https://p0.meituan.net/movie/ebf1b5c2636804f62b0e407b66abf58f6875.jpg@128w_170h_1e_1c", "片渊须直"], "actors": [["https://p0.meituan.net/movie/1d094b88ef987523e7225987971511c327818.jpg@128w_170h_1e_1c", "能年玲奈", "饰：北条(浦野)すず"], ["https://p0.meituan.net/moviemachine/5ff6aeb8a7d150213a6d752392639323151782.jpg@128w_170h_1e_1c", "细谷佳正", "饰：北条周作"], ["https://p0.meituan.net/movie/3a7cb5ed76dc561c752b102fffa17f2d10384.jpg@128w_170h_1e_1c", "牛山茂", "饰：北条丹太郎"], ["https://p0.meituan.net/movie/c983cb56e84c9ff0ac322e7d3463da2c12181.jpg@128w_170h_1e_1c", "尾身美词", "饰：黑村径子"], ["https://p0.meituan.net/movie/1d094b88ef987523e7225987971511c327818.jpg@128w_170h_1e_1c", "能年玲奈", "饰：北条(浦野)すず"], ["https://p0.meituan.net/moviemachine/5ff6aeb8a7d150213a6d752392639323151782.jpg@128w_170h_1e_1c", "细谷佳正", "饰：北条周作"], ["https://p0.meituan.net/movie/3a7cb5ed76dc561c752b102fffa17f2d10384.jpg@128w_170h_1e_1c", "牛山茂", "饰：北条丹太郎"], ["https://p0.meituan.net/movie/c983cb56e84c9ff0ac322e7d3463da2c12181.jpg@128w_170h_1e_1c", "尾身美词", "饰：黑村径子"], ["https://p0.meituan.net/movie/960e3a989c24d24d2622fd99802918e086103.jpg@128w_170h_1e_1c", "稻叶菜月", "饰：黑村晴美"], ["https://p0.meituan.net/movie/033f05e5e93739ac061de276e142909d18468.jpg@128w_170h_1e_1c", "新谷真弓", "饰：北條サン"], ["https://p0.meituan.net/movie/8f21fccf39b76077ad82a1c57b11684c38898.jpg@128w_170h_1e_1c", "小野大辅", "饰：水原哲"], ["https://p1.meituan.net/movie/06c2108adf3653fd5bd288e0310