{"movieId": "905", "picture": "https://p1.meituan.net/movie/20b81c48788d6f73a07fec370baabad4103840.jpg@464w_644h_1e_1c", "name": "爱在日落黄昏时", "name2": "Before Sunset", "type": [" 剧情 ", " 爱情 "], "place": "美国", "length": "80分钟", "time": "2015-04-20中国大陆上映", "description": "影片讲述了九年过后一段缘分的再续。维也纳浪漫一夜过去九年后，赛琳（朱丽·德尔比 饰）和杰西（伊桑·霍克 饰）终于在巴黎再次相遇。九年过去了，杰西已成为畅销书作家，而赛琳则在环保组织工作。杰西在巴黎的莎士比亚书店举行他在欧洲的最后一站新书发布会，书中写的就是他和赛琳在维也纳发生的故事，恰好，赛琳就出现在了观众席上。他们只有一下午的时间，日落之前杰西就要飞回美国。这个下午，他们在午后的巴黎街头散步，在美丽的赛纳河上泛舟……他们无所不谈，好似从未分开……", "director": ["https://p1.meituan.net/movie/2c08b97e2ec1c7476b3103f928576d8441733.jpg@128w_170h_1e_1c", "理查德·林克莱特"], "actors": [["https://p1.meituan.net/movie/3557fcf59b297f2ba7f98ceb9b26cbba53090.jpg@128w_170h_1e_1c", "伊桑·霍克", "饰：杰西 Jesse"], ["https://p0.meituan.net/movie/fb31aae6c5d379b40c99c2901df787f646278.jpg@128w_170h_1e_1c", "朱莉·德尔佩", "饰：赛琳 Celine"], ["https://p0.meituan.net/movie/a5e2da80c4901042ac76c839fdae41c840125.jpg@128w_170h_1e_1c", "弗农·多布切夫", "饰：书店经理 Bookstore Manager"], ["https://p0.meituan.net/movie/4c16569bffa9bf55a1c1051bc15a934b49940.jpg@128w_170h_1e_1c", "路易丝·勒莫瓦纳·托雷斯", "饰：记者甲 Journalist #1"], ["https://p1.meituan.net/movie/3557fcf59b297f2ba7f98ceb9b26cbba53090.jpg@128w_170h_1e_1c", "伊桑·霍克", "饰：杰西 Jesse"], ["https://p0.meituan.net/movie/fb31aae6c5d379b40c99c2901df787f646278.jpg@128w_170h_1e_1c", "朱莉·德尔佩", "饰：赛琳 Celine"], ["https://p0.meituan.net/movie/a5e2da80c4901042ac76c839fdae41c840125.jpg@128w_170h_1e_1c", "弗农·多布切夫", "饰：书店经理 Bookstore Manager"], ["https://p0.meituan.net/movie/4c16569bffa9bf55a1c1051bc15a934b49940.jpg@128w_170h_1e_1c", "路易丝·勒莫瓦纳·托雷斯", "饰：记者甲 Journalist #1"], ["https://p1.meituan.net/movie/81992363b0307c7d9948c1b03632af4826121.jpg@128w_170h_1e_1c", "罗多尔·保利", "饰：记者乙 Journalist #2"], ["https://p1.meituan.net/movie/435c0d4732198b3080d4b3ae297f96d144386.jpg@128w_170h_1e_1c", "玛丽安·普莱施泰格", "饰：女侍者 Waitress"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "Diabolo", "饰：菲利普 Philippe"], ["https://p