{"movieId": "1249366", "picture": "https://p1.meituan.net/movie/92719942184f8690888e6c3a18310f2a3700153.jpg@464w_644h_1e_1c", "name": "少年斯派维的奇异旅行", "name2": "The Young and Prodigious T.S. Spivet", "type": [" 剧情 ", " 家庭 ", " 冒险 "], "place": "法国,澳大利亚,加拿大", "length": "105分钟", "time": "2013-10-16法国上映", "description": "小小少年T.S. 斯派维（凯尔·凯特莱特 饰）生于蒙大拿州一个偏远牧场，他有一颗聪明绝顶的大脑，酷爱制图学和科学图解，年仅十岁就发明了永动机。他的父亲（考乐姆·吉斯·雷尼 饰）是个狂热的牛仔迷，搜集关于西部牛仔的一切；母亲（海伦娜·伯翰·卡特 饰）是一位生物学博士，潜心投入到昆虫研究中；而姐姐则是一个最普通不过的正常人，她常常为生在这个一屋子怪人的家里而烦恼。T.S.原本还有一个异卵双胞胎弟弟雷顿（雅各布·戴维斯 饰），去年死于一场意外。这天，T.S.接到一个来自史密森学院的电话，告知他被授予了世界科学大奖贝尔德奖，并邀请他到华盛顿演讲。于是，十岁的科学奇才T.S.斯派维，偷偷爬上了货运火车，独自踏上了穿越美国的奇异旅行。", "director": ["https://p1.meituan.net/movie/2310bfc4c7ebf5e1f64bf1ea8fbee74538162.jpg@128w_170h_1e_1c", "让-皮埃尔·热内"], "actors": [["https://p0.meituan.net/movie/a63c2c06d4f01fe700c7e7c4aa1c20ab45022.jpg@128w_170h_1e_1c", "凯尔·凯特莱特", "饰：T.S 斯派维 T. S. Spivet"], ["https://p1.meituan.net/movie/be5089e588048e9cb17d2502584df9d563067.jpg@128w_170h_1e_1c", "海伦娜·伯翰·卡特", "饰：斯派维母亲（克莱尔博士） Dr. Clair"], ["https://p1.meituan.net/movie/e593800e0ea329fc39dc79e3ae7b217831458.jpg@128w_170h_1e_1c", "罗伯特·梅耶", "饰：Giant Hobo"], ["https://p0.meituan.net/movie/c449a0970b8a0fdd650cfcf20e86d49548394.jpg@128w_170h_1e_1c", "朱迪·戴维斯", "饰：Jibsen"], ["https://p0.meituan.net/movie/a63c2c06d4f01fe700c7e7c4aa1c20ab45022.jpg@128w_170h_1e_1c", "凯尔·凯特莱特", "饰：T.S 斯派维 T. S. Spivet"], ["https://p1.meituan.net/movie/be5089e588048e9cb17d2502584df9d563067.jpg@128w_170h_1e_1c", "海伦娜·伯翰·卡特", "饰：斯派维母亲（克莱尔博士） Dr. Clair"], ["https://p1.meituan.net/movie/e593800e0ea329fc39dc79e3ae7b217831458.jpg@128w_170h_1e_1c", "罗伯特·梅耶", "饰：Giant Hobo"], ["https://p0.meituan.net/movie/c449a0970b8a0fdd650cfcf20e86d49548394.jpg@128w_170h_1e_1c", "朱迪·戴维斯", "饰：Jibsen"], ["https://p1.meituan.net/movie/088215d1ab85e12b5b700927d08cd25648438.jpg@128w_170h_1e_1c", "考乐姆·吉斯·雷尼", "饰：斯派维父亲 Father"], ["https://p0.meituan.net/movie/98df758a1cc389078960bc9d364afb5f36590.jpg@128w_170h_1e_1c", "朱利安·瑞钦斯", "饰：Ricky"], ["https://p1.m