{"movieId": "1355963", "picture": "https://p0.meituan.net/movie/4579904e1e57e91cdb253995ab001fc8247165.jpg@464w_644h_1e_1c", "name": "洛丽塔", "name2": "Lolita", "type": [" 剧情 ", " 爱情 "], "place": "美国,英国", "length": "153分钟", "time": "1962-06-13美国上映", "description": "在大学教授法文的亨博特（James Mason 詹姆斯•梅森 饰）少年时期曾有一段刻骨铭心的经历，当年的初恋情人不幸夭亡，令他此去经年依旧对那些充满青春气息的少女有着别样情感。 因工作之需，亨博特寻找住房，因此结识了寡妇夏洛特（Shelley Winters谢利•温特斯 饰）及其妖精一般的女儿洛丽塔（Sue Lyon 休•莱昂 饰）。夏洛特迷上了这位儒雅庄重的大学教师，一心与之交往；而亨博特却迷恋上了青春逼人的洛丽塔，为了和这个精灵长相厮守，甚至违心与夏洛特结婚。他将对洛丽塔的情感全部写进日记，锁入抽屉。直到某天夏洛特打开了潘多拉宝盒，他们的命运从此改变…… 本片根据作家纳博科夫同名小说改编。", "director": ["https://p1.meituan.net/movie/d709f471690b6dd5de168849d1d79cb135619.jpg@128w_170h_1e_1c", "斯坦利·库布里克"], "actors": [["https://p0.meituan.net/movie/e2b060496ec75bd0242c22a969e28dd729196.jpg@128w_170h_1e_1c", "詹姆斯·梅森", "饰：Prof. Humbert Humbert"], ["https://p1.meituan.net/movie/f7180e4e77d8c6cdbd1ffa249739c8d841080.jpg@128w_170h_1e_1c", "谢利·温特斯", "饰：Charlotte Haze"], ["https://p1.meituan.net/moviemachine/bddb6212e303e2307547443e980ec66257922.jpg@128w_170h_1e_1c", "苏·莱恩", "饰：Lolita"], ["https://p1.meituan.net/movie/364824f567458d9ec058ae29625c9a03214291.jpg@128w_170h_1e_1c", "加里·科克雷尔", "饰：Richard T. Schiller"], ["https://p0.meituan.net/movie/e2b060496ec75bd0242c22a969e28dd729196.jpg@128w_170h_1e_1c", "詹姆斯·梅森", "饰：Prof. Humbert Humbert"], ["https://p1.meituan.net/movie/f7180e4e77d8c6cdbd1ffa249739c8d841080.jpg@128w_170h_1e_1c", "谢利·温特斯", "饰：Charlotte Haze"], ["https://p1.meituan.net/moviemachine/bddb6212e303e2307547443e980ec66257922.jpg@128w_170h_1e_1c", "苏·莱恩", "饰：Lolita"], ["https://p1.meituan.net/movie/364824f567458d9ec058ae29625c9a03214291.jpg@128w_170h_1e_1c", "加里·科克雷尔", "饰：Richard T. Schiller"], ["https://p0.meituan.net/movie/12c8fea61576940f66fcecc95313c1106234.jpg@128w_170h_1e_1c", "杰里·斯托文", "饰：John Farlow"], ["https://p1.meituan.net/movie/7fbcaf25f1ff1ffa0cf3aeddffef6e2010781.jpg@128w_170h_1e_1c", "黛安娜·戴克", "饰：Jean Farlow"], ["https://p0.meituan.net/movie/1c3b0deaf98902ee9e126d0e5cb9bed710279.jp