{"movieId": "1286060", "picture": "https://p0.meituan.net/movie/59cc24b78a746b821bc7af99c5db639a285758.jpg@464w_644h_1e_1c", "name": "小鬼当家2", "name2": "Home Alone 2: Lost in New York", "type": [" 喜剧 ", " 家庭 ", " 犯罪 "], "place": "美国", "length": "120分钟", "time": "1992-11-20多平台上线", "description": "一年一度的圣诞节即将来临， 凯文一家又在为今年的圣诞旅行各自忙碌着，准备到佛罗里达去享受他们的圣诞假期。只有凯文 （ 麦考利·卡尔金 饰）显得格外安静，因为在他的心中正期待着一个只属于自己的圣诞节。清晨，全家人又因为起晚了而匆匆拎上行李、慌忙地赶往机场。这一次，他们没有把小凯文落下，但在机场混乱的人群中，凯文误把别人当成了父亲，跟着他登上了开往纽约的飞机，当他走下飞机后才恍然大悟，不过他可并不打算为此而伤心，相反凯文暗自庆幸着终于能自由自在地过圣诞节了。第一次来到这个完全陌生的大城市，聪明机灵的凯文也不禁暗暗害怕。纽约是个美丽而繁华的城市，凯文从收音机里得知这里有一家豪华的广场宾馆，于是他用父亲的证件和信用卡预定了房间。一个不满十岁的小孩独自住在超豪华的总统套间里 ，这不免引起了宾馆服务员的好奇，晚上他们鬼鬼祟祟地潜入凯文的房间，想一探究竟，机智的凯文利用奶奶送给他的水上木偶和录音机吓跑了服务员。凯文乘坐着豪华轿车来到玩具城为自己购买圣诞礼物，沉浸在幸福之中的他突然看到两张熟悉的面孔，去年圣诞节被他送进监狱的两个水盗越狱后逃到纽约，正打算抢劫玩具城，能再次碰到凯文，他们当然不会放过报仇的机会。两个水盗自作聪明地认为，有了上次的经验，这次一定不会再让这个小鬼得逞了，可这一次，凯文为他们准备的机关更加“精彩”，从天而降的砖头雨、长了腿的工具柜、满是漆料的马桶、掩藏在门口的无底洞，几个回合的较量，两个水盗已经遍体鳞伤，毫无招架之力，最终被再次送上了警车。", "director": ["https://p0.meituan.net/movie/02ff74a6ae263402ac73583fe5149ff536190.jpg@128w_170h_1e_1c", "克里斯·哥伦布"], "actors": [["https://p1.meituan.net/movie/b39485e4bc48dd0970464bafcd20c2b347149.jpg@128w_170h_1e_1c", "麦考利·卡尔金", "饰：Kevin McCallister"], ["https://p1.meituan.net/movie/c6e544e7d2a0145105ee532f16638e8e39939.jpg@128w_170h_1e_1c", "乔·佩西", "饰：Harry Lime"], ["https://p0.meituan.net/movie/addc245c299c156aafe96d38f6d8974644497.jpg@128w_170h_1e_1c", "丹尼尔·斯特恩", "饰：Marv Merchants"], ["https://p1.meituan.net/movie/f8dadcd94894e8f5bca7feb51d6e560b10429.jpg@128w_170h_1e_1c", "凯瑟琳·欧哈拉", "饰：Kate McCallister"], ["https://p1.meituan.net/movie/b39485e4bc48dd0970464bafcd20c2b347149.jpg@128w_170h_1e_1c", "麦考利·卡尔金", "饰：Kevin McCallister"], ["https://p1.meituan.net/movie/c6e544e7d2a0145105ee532f16638e8e39939.jpg@128w_170h_1e_1c", "乔·佩西", "饰：Harry Lime"], ["https://p0.meituan.net/movie/addc245c299c156aafe96d38f6d8974644497.jpg@128w_170h_1e_1c", "丹尼尔·斯特恩", "饰：Marv Merchants"], ["https://p1.meituan.net/movie/f8dadcd94894e8f5bca7feb51d6e560b10429.jpg@128w_170h_1e_