{"movieId": "1198925", "picture": "https://p1.meituan.net/movie/1a385aecf33798d5c42440ef67ce2305166594.jpg@464w_644h_1e_1c", "name": "被我遗弃的时光", "name2": null, "type": [" 青春 "], "place": "中国大陆", "length": "115分钟", "time": null, "description": "该片是一部以青春为背景并讲述年轻的女孩在父亲的影响下如何完成自我成长与升级的温情影片。影片主要讲述了两个不同的家庭发生的故事，一个家庭以注重实现自身价值为人生信条，兢兢业业去做好每一件事情，承担家庭，以及对社会的责任。另一个家庭则以金钱至上为人生目标，站在金钱的角度上去衡量每一件事情。一个家庭注重内在，另一个家庭注重物质，这两种截然不同家庭，他们的人生观、价值观、社会观以及教育下一代等方面形成了鲜明的对比，既有为了金钱而奋斗的场景，也有父女两代人为了实现自身价值而付出的艰辛与努力的励志情节。", "director": ["https://p0.meituan.net/movie/14dc3e90ec736e6c69739732dfc3385d44987.jpg@128w_170h_1e_1c", "张承"], "actors": [["https://p0.meituan.net/moviemachine/f28a7ac2bed6d253bbbd10cc5cab30f6144878.jpg@128w_170h_1e_1c", "富大龙", null], ["https://p1.meituan.net/moviemachine/c5f0d368a1dfb63a97a21bd955a2be8527535.jpg@128w_170h_1e_1c", "黄尧", null], ["https://p0.meituan.net/movie/08b19352c9afe17900d38a0a5516fd4223398.jpg@128w_170h_1e_1c", "陈思娜", null], ["https://p0.meituan.net/moviemachine/f28a7ac2bed6d253bbbd10cc5cab30f6144878.jpg@128w_170h_1e_1c", "富大龙", null], ["https://p1.meituan.net/moviemachine/c5f0d368a1dfb63a97a21bd955a2be8527535.jpg@128w_170h_1e_1c", "黄尧", null], ["https://p0.meituan.net/movie/08b19352c9afe17900d38a0a5516fd4223398.jpg@128w_170h_1e_1c", "陈思娜", null]]}
