{"movieId": "78919", "picture": "https://p0.meituan.net/movie/c24537d5e345b9ed3b9397d0d07179c3394153.jpg@464w_644h_1e_1c", "name": "可可西里", "name2": "Kekexili", "type": [" 剧情 ", " 犯罪 "], "place": "中国大陆,中国香港", "length": "85分钟", "time": "2004-10-01中国大陆上映", "description": "尕玉（张磊 饰）本来是个警察，为了调查藏羚羊猎杀状况，他假扮记者身份，随考察团来到可可西里——那里气候寒冷、空气稀薄，含氧量极低。就在这个人类生存的“禁区”，尕玉目睹了一幕幕人性的贪婪以及人类与环境的狂暴冲突。首先是藏羚羊保护站的巡山队员被盗猎人枪杀，接下来他们见到了悲惨的一幕：盗猎者逃走，只留下众多只剩嶙峋白骨的藏羚羊。巡山队员在恶劣的环境中追捕凶手，最终只夺回了一部份的藏羚羊皮毛。一方面要与恶劣的自然环境抗争、另一方面还要与凶残的盗猎者周旋，巡山队员和尕玉面临着生死考验。", "director": ["https://p0.meituan.net/movie/201527183578c78521a168ae94a9899c22712.jpg@128w_170h_1e_1c", "陆川"], "actors": [["https://p1.meituan.net/moviemachine/a588e14ddeec14b8fa8652972fbbd174172551.jpg@128w_170h_1e_1c", "多布杰", "饰：日泰"], ["https://p0.meituan.net/moviemachine/b66d9a94debb0d23cc9dacbd52b933c241537.jpg@128w_170h_1e_1c", "奇道", "饰：刘栋"], ["https://p0.meituan.net/movie/872e226095fe30c194a8d925a1b4a3d6112964.jpg@128w_170h_1e_1c", "张正阳", "饰：尕玉"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "马占林", "饰：Old Ma"], ["https://p1.meituan.net/moviemachine/a588e14ddeec14b8fa8652972fbbd174172551.jpg@128w_170h_1e_1c", "多布杰", "饰：日泰"], ["https://p0.meituan.net/moviemachine/b66d9a94debb0d23cc9dacbd52b933c241537.jpg@128w_170h_1e_1c", "奇道", "饰：刘栋"], ["https://p0.meituan.net/movie/872e226095fe30c194a8d925a1b4a3d6112964.jpg@128w_170h_1e_1c", "张正阳", "饰：尕玉"], ["https://p0.meituan.net/moviemachine/b99384cf1eacb139fde0509af424af6623037.png@128w_170h_1e_1c", "马占林", "饰：Old Ma"], ["https://p1.meituan.net/movie/b94c98926885d1e6a0b6f8df8798e0f020904.jpg@128w_170h_1e_1c", "赵雪莹", "饰：冷雪"], ["https://p0.meituan.net/movie/7eb8f3cb335639728cff63fd95b9a09255527.jpg@128w_170h_1e_1c", "赵一穗", "饰：洛桑"], ["https://p0.meituan.net/movie/db4bbfbe7e0753f06b8e62391abf79a613416.jpg@128w_170h_1e_1c", "更松永措", "饰：央金"], ["https://p0.meituan.net/movie/0ed292c3f1ce1dd0e5c4a032e6668eb8100191.jpg@128w_170h_1e_1c", "张垒", "饰：尕玉"]]}
